#define OP_TYPE_VARIANT(op, _j) \
  (PL_op_type_variants[(op)][(_j)] \
    ? (op) + PL_op_type_variants[(op)][(_j)] \
    : 0)
#define OP_TYPE_UPVARIANT(op, _j) \
  (PL_op_type_variants[(op)][(_j)] && PL_op_type_variants[(op)][(_j)]>0 \
    ? (op) + PL_op_type_variants[(op)][(_j)] \
    : 0)
#define OP_TYPE_DOWNVARIANT(op, _j) \
  (PL_op_type_variants[(op)][(_j)] && PL_op_type_variants[(op)][(_j)]<0 \
    ? (op) + PL_op_type_variants[(op)][(_j)] \
    : 0)

